import React from "react";

function PopUp(props) {
  return (
    <div className="popup-box">
      <div className="box">
        <button className="btn-close" onClick={props.handleClose}>
          X
        </button>
        {props.content}
      </div>
    </div>
  );
}

export default PopUp;
